import React from "react";
import { Row, Col } from "antd";
import LoginForm from "../../components/LoginForm";
import {
  GlobalContainer,
  ContentContainer,
  ContentBox,
  ImageSection,
  Image,
  LoginBox,
  Title,
  TitleLogo,
  TitleTextBox,
  TitleSubtextBox,
} from "./styles";
import CampusImage from "../../static/img/first_bg_round_real.png";
import LogoImage from "../../static/img/first_bg_round_real.png";

const login = () => {
  return (
    <GlobalContainer>
      <ContentContainer>
        <Row>
          <Col xs={24} md={12}>
            <ContentBox>
              <Title>
                <TitleLogo src={Logo}></TitleLogo>
                <TitleTextBox>끊임없이 새로운 지식과 지혜를 추구하겠는가?</TitleTextBox>
                <TitleSubtextBox>아니면, 도태되어 쓸모없는 사람으로 결국 길거리에 나앉겠는가?</TitleSubtextBox>
              </Title>
              <ImageSection className="forth-box_flow">
                <Image src={CampusImage} alt="campusImage" />
              </ImageSection>

              <div></div>
            </ContentBox>
          </Col>
          <Col xs={24} md={12}>
            <LoginBox>
              <LoginForm />
            </LoginBox>
          </Col>
        </Row>
      </ContentContainer>
      {/* <Footer>

      </Footer> */}
    </GlobalContainer>

    /* <Row gutter={8}>
        <Col xs={24} md={6} />
        <Col xs={24} md={12}>
          <LoginForm />
        </Col>
        <Col xs={24} md={6} />
      </Row> */
  );
};

export default login;
